export { default as Contact } from "./Contact";
export { default as Blog } from "./Blog";
export { default as Postphotography } from "./Postphotography";
// export { default as Topshopify } from "./top-shopify-marketing-strategy-for-sellers";
// export { default as Videoediting } from "./5-interesting-video-editing-facts";
const rootElement = document.getElementById("root");
if (rootElement.hasChildNodes()) {
  hydrate(<App />, rootElement);
} else {
  render(<App />, rootElement);
}
